import React from "react";
import "./header.css";
import logo from "../../assets/images/eco-logo.png";
import { Container, Row } from "reactstrap";

const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          <div className="nav__wrapper">
            <div className="logo">
              <img src={logo} alt="logo" />
              <div>
                <h1>Vicomart</h1>
                <p>Since 2009</p>
              </div>
            </div>
          </div>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
